import {
  CREATE,
  UPDATE,
  DELETE,
  GET_ALL,
  GET_ONE,
  LIKE,
} from "../constants/actionTypes";

const adventurePostsReducer = (state = {}, action) => {
  switch (action.type) {
    case CREATE:
      return state;

    case UPDATE:
      return state;

    case DELETE:
      return state;
    case GET_ALL:
      return action.payload;

    case GET_ONE:
      return state;

    case LIKE:
      return state;
    default:
      return state;
  }
};
